import {Link}  from 'react-router-dom';
import { useState } from 'react';
const Viewfeedback = () =>{
    return(
     

      <nav className="navbar bg-body-tertiary bg-dark  p-4 h1">
      <div className="container-fluid">
  <span className="navbar-brand mb-0 h1">Feedback Portal</span>
    <Link to="/A" className="menu"> <button className="btn btn-primary" type="submit" onClick={() => setIsHidden(true)}>Add Feedback</button></Link>
    {isHidden && <button>Hidden Button</button>}
   
  </div>
</nav>
    )
}

export default Viewfeedback;
